import React, { useRef } from 'react';
import '../style/Profile.css';
import profileIcon from "../Images/profile icon.png";

export default function Profile() {
  const fileInputRef = useRef(null);
  const profilePhotoRef = useRef(null);

  const handleButtonClick = () => {
    fileInputRef.current.click();
  };

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        profilePhotoRef.current.src = e.target.result;
      };
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="rout-container">
      <div className="profile-container">
        
        <div className="side-section">
          <div className="side-content">
            <div className="profile-picture">
              <img src={profileIcon} ref={profilePhotoRef} id="profile-photo" alt="profile icon" />
              <div className="upload-photo-button">
                <input
                  type="file"
                  ref={fileInputRef}
                  style={{ display: 'none' }}
                  onChange={handleFileChange}
                />
                <label onClick={handleButtonClick} id="upload-image-button">
                  <i className="fa fa-camera"></i>
                </label>
              </div>
            </div>
            <button className="profile-buttons edit-Profile-button">
              <a>Edit Profile</a>
            </button>
            <button className="profile-buttons change-password-button">
              <a>Change Password</a>
            </button>
          </div>
        </div>

        <div className="main-section">
          <div className="profile-details">
            <div className="profile-item user-id">
              <div className="profile-items-heading">User Id</div>
              <div className="profile-items-main-content">2104031</div>
            </div>
            <div className="profile-item Name">
              <div className="profile-items-heading">Name</div>
              <div className="profile-items-main-content">Shahriar Khaled Fahim</div>
            </div>
            <div className="profile-item gender">
              <div className="profile-items-heading">Gender</div>
              <div className="profile-items-main-content">Male</div>
            </div>
            <div className="profile-item date-of-birth">
              <div className="profile-items-heading">Date of Birth</div>
              <div className="profile-items-main-content">1 January, 2003</div>
            </div>
            <div className="profile-item phone-Number">
              <div className="profile-items-heading">Contact</div>
              <div className="profile-items-main-content">01234567891</div>
            </div>
            <div className="profile-item email">
              <div className="profile-items-heading">Email</div>
              <div className="profile-items-main-content">bugijugiemailid@gmail.com</div>
            </div>
            <div className="profile-item blood-group">
              <div className="profile-items-heading">Blood Group</div>
              <div className="profile-items-main-content">F+</div>
            </div>
            <div className="profile-item adress">
              <div className="profile-items-heading">Adress</div>
              <div className="profile-items-main-content">Mars colony, Road 1, Mars city, Mars</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
